// CaseOpened.js
import React from 'react';
import './styles/Case_opened.css';

import freecase1 from '../assets/case/freecase1.png';

import tier1 from '../assets/frame/tier1.png';
import tier2 from '../assets/frame/tier2.png';
import tier3 from '../assets/frame/tier3.png';
import tier4 from '../assets/frame/tier4.png';
import tier5 from '../assets/frame/tier5.png';


function Case_Opened(){
    return(
        <>
            <div className="opencase" id='free1'>
                <h1>Freecase1</h1>
                <img src={freecase1} alt="" />
                <button>Open $0.00</button>
            </div>

            <div className="case_item">
                <div className="image-container">
                    <img src={require('../assets/skin/Freecase1/tier1/Fc1-1-1.png')} className="tier1"/>
                    <img src={require('../assets/skin/Freecase1/tier1/Fc1-1-2.png')} className="tier1"/>
                    
                    <img src={require('../assets/skin/Freecase1/tier2/Fc1-2-1.png')} className="tier2"/>
                    <img src={require('../assets/skin/Freecase1/tier2/Fc1-2-2.png')} className="tier2"/>
                    <img src={require('../assets/skin/Freecase1/tier2/Fc1-2-3.png')} className="tier2"/>
                    
                    <img src={require('../assets/skin/Freecase1/tier3/Fc1-3-1.png')} className="tier3"/>
                    <img src={require('../assets/skin/Freecase1/tier3/Fc1-3-2.png')} className="tier3"/>
                    <img src={require('../assets/skin/Freecase1/tier3/Fc1-3-3.png')} className="tier3"/>

                    <img src={require('../assets/skin/Freecase1/tier4/Fc1-4-1.png')} className="tier4"/>
                    <img src={tier4_2} className="tier4"/>

                    <img src={tier5_1} className="tier5"/>
                    <img src={tier5_2} className="tier5"/>
                </div>
            </div>
        </>
    );
}

export default Case_Opened;
